class MyFunctions{static showMemory(e){if(frameCount%e!=0)return;let o=performance.memory;console.log(o);let t=o.usedJSHeapSize/o.jsHeapSizeLimit;console.log(`メモリ使用率: ${100*t} %`),console.log(`----稼働時間: ${frameCount/60}秒----`)}static shuffle(e){for(let o=e.length-1;o>=0;o--){let t=Math.floor(Math.random()*o);[e[o],e[t]]=[e[t],e[o]]}}}